function Phi = Phi_disc(om_mag,omega_x,dt)
%#codegen
% State Transition Matrix
w_n     = om_mag;
w_skew  = omega_x;

if( w_n < 1e-10 )
    Phi = [ eye(3)     -eye(3)*dt;
            zeros(3,3)  eye(3) ];
else
    Phi_11  = eye(3) - w_skew*(sin(w_n*dt)/w_n) + ...
                                        w_skew^2*(1 - cos(w_n*dt))/w_n^2;
    Phi_12  = w_skew*(1 - cos(w_n*dt))/w_n^2 - eye(3)*dt - ...
                                    w_skew^2*(w_n*dt - sin(w_n*dt))/w_n^3;
    Phi_21  = zeros(3,3);    
    Phi_22  = eye(3);    
    Phi     = [ Phi_11 Phi_12;
                Phi_21 Phi_22 ];
end

function P_sq_plus1  = time_qr(P_sq,Phi_discrete,Q_sq)
%#codegen

C = [P_sq'*Phi_discrete';Q_sq'];
          [~,R2] = qr(C);
         P_sq_plus1 = R2(1:6,1:6)';

end
